func leftmostBuildingQueries(heights []int, queries [][]int) []int {
    n := len(heights)
    ans := make([]int, len(queries))

    for i, query := range queries {
        alice, bob := query[0], query[1]
        meet := -1

        if alice > bob {
            alice, bob = bob, alice
        }

        maxFromAlice := heights[alice]
        for j := alice + 1; j < n; j++ {
            if heights[j] > maxFromAlice {
                maxFromAlice = heights[j]
                if j >= alice && j <= bob {
                    meet = j
                    break
                }
            }
        }

        if meet != -1 {
            maxFromBob := heights[bob]
            for j := bob - 1; j > meet; j-- {
                if heights[j] > maxFromBob {
                    meet = -1
                    break
                }
                maxFromBob = max(maxFromBob, heights[j])
            }
        }

        ans[i] = meet
    }

    return ans
}
